(10, 'testing posts', '&lt;p style=&quot;margin: 0.5em 0px; color: rgb(32, 33, 34); font-family: sans-serif; font-size: 14px;&quot;&gt;&lt;b&gt;Text messaging&lt;/b&gt;, or&amp;nbsp;&lt;b&gt;texting&lt;/b&gt;, is the act of composing and sending electronic messages, typically consisting of alphabetic and numeric characters, between two or more users of&amp;nbsp;&lt;a href=&quot;https://en.wikipedia.org/wiki/Mobile_device&quot; title=&quot;Mobile device&quot; style=&quot;color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;mobile devices&lt;/a&gt;,&amp;nbsp;&lt;a href=&quot;https://en.wikipedia.org/wiki/Desktop_computer&quot; title=&quot;Desktop computer&quot; style=&quot;color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;desktops&lt;/a&gt;/&lt;a href=&quot;https://en.wikipedia.org/wiki/Laptop&quot; title=&quot;Laptop&quot; style=&quot;color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;laptops&lt;/a&gt;, or another type of compatible computer. Text messages may be sent over a&amp;nbsp;&lt;a href=&quot;https://en.wikipedia.org/wiki/Cellular_network&quot; title=&quot;Cellular network&quot; style=&quot;color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;cellular network&lt;/a&gt;, or may also be sent via an&amp;nbsp;&lt;a href=&quot;https://en.wikipedia.org/wiki/Internet&quot; title=&quot;Internet&quot; style=&quot;color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;Internet&lt;/a&gt;&amp;nbsp;connection.&lt;/p&gt;&lt;p style=&quot;margin: 0.5em 0px; color: rgb(32, 33, 34); font-family: sans-serif; font-size: 14px;&quot;&gt;The term originally referred to messages sent using the&amp;nbsp;&lt;a href=&quot;https://en.wikipedia.org/wiki/SMS&quot; title=&quot;SMS&quot; style=&quot;color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;Short Message Service&lt;/a&gt;&amp;nbsp;(SMS). It has grown beyond alphanumeric text to include multimedia messages using the&amp;nbsp;&lt;a href=&quot;https://en.wikipedia.org/wiki/Multimedia_Messaging_Service&quot; title=&quot;Multimedia Messaging Service&quot; style=&quot;color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;Multimedia Messaging Service&lt;/a&gt;&amp;nbsp;(MMS) containing digital images, videos, and sound content, as well as ideograms known as&amp;nbsp;&lt;a href=&quot;https://en.wikipedia.org/wiki/Emoji&quot; title=&quot;Emoji&quot; style=&quot;color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;emoji&lt;/a&gt;&amp;nbsp;(&lt;a href=&quot;https://en.wikipedia.org/wiki/Smiley&quot; title=&quot;Smiley&quot; style=&quot;color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;happy faces&lt;/a&gt;, sad faces, and other icons), and&amp;nbsp;&lt;a href=&quot;https://en.wikipedia.org/wiki/Instant_messenger&quot; class=&quot;mw-redirect&quot; title=&quot;Instant messenger&quot; style=&quot;color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;instant messenger&lt;/a&gt;&amp;nbsp;applications (usually the term is used when on mobile devices).&lt;/p&gt;&lt;p style=&quot;margin: 0.5em 0px; color: rgb(32, 33, 34); font-family: sans-serif; font-size: 14px;&quot;&gt;&lt;img src=&quot;data:image/png;base64,&quot; style=&quot;width: 750.125px;&quot; data-filename=&quot;honey bunny bank acc.PNG&quot;&gt;&lt;br&gt;&lt;/p&gt;', 12, 6, '0', NULL, '2021-12-09 11:42:32');
